def calculate_non_a_characters(matrix, queries):
    N = len(matrix)
    crr = [[[0, 0] for _ in range(N + 1)] for _ in range(N + 1)]
    for i in range(2, N + 1):
        for j in range(1, N + 1):
            if matrix[i - 1][j - 1] == 'a':
                crr[i][j][0] = max(crr[i - 1][j][0], crr[i][j - 1][0]) + 1
                if j == 1:
                    crr[i][j][1] = crr[i - 1][j][1] + 1
                elif i == 1:
                    crr[i][j][1] = crr[i][j - 1][1] + 1
                elif crr[i - 1][j][0] > crr[i][j - 1][0]:
                    crr[i][j][1] = crr[i - 1][j][1] + 1
                else:
                    crr[i][j][1] = crr[i][j - 1][1] + 1
            else:
                crr[i][j][0] = max(crr[i - 1][j][0], crr[i][j - 1][0])
                if j == 1:
                    crr[i][j][1] = crr[i - 1][j][1] + 1
                elif i == 1:
                    crr[i][j][1] = crr[i][j - 1][1] + 1
                elif crr[i - 1][j][0] > crr[i][j - 1][0]:
                    crr[i][j][1] = crr[i - 1][j][1] + 1
                else:
                    crr[i][j][1] = crr[i][j - 1][1] + 1
    results = []
    for (X, Y) in queries:
        results.append(crr[X][Y][1] - crr[X][Y][0])
    return results

